import {Container,Nav,Navbar,Row,Col} from 'react-bootstrap';
import './App.css';
import { useState } from 'react';

function App() {

  let [modal,setModal]=useState(false);
  return (   

    <div className="App">
      <Navbar className="Header" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <body className="Body">
        <h4>OUTWEAR</h4> 
        <hr></hr>
        <button onClick={()=>setModal(!modal)} aria-expanded="false" aria-controls="refinement-wrap">Filters &amp; sort by<i></i></button>
        {modal==true?<Modal></Modal>:null}
        <hr></hr>
        <button className="Tag">태그 X</button>

        <Container>
          <Row>
            <Col><div className="Item">1</div></Col>
            <Col>2</Col>
            <Col>3</Col>
          </Row>
          <Row>
            <Col>4</Col>
            <Col>5</Col>
            <Col>6</Col>
          </Row>
        </Container>
      </body>

    </div>
  );
}

function Modal(){
  return(
    <div className="Modal">
      <p>스타일 선택</p>
      <p>색상 선택</p>
      <p>sort</p>
    </div>
  )
}

export default App;
